import React, { useState } from 'react';
import { Link } from 'react-router-dom';

import './Post.scss';

const Post = ({ postInfo, userInfo }) => {
  const [postInf, setPostInf] = useState(postInfo);
  const [userInf, setUserInf] = useState(userInfo);

  return (
    <article className="post">
      <div> {postInf} </div>
      <div> {userInf} </div>
    </article>
  );
};

export default Post;
